import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Container, Row, Col, Card, CardHeader, Button } from "shards-react";
import { getAllDietitians } from "../../actions/superadmin/dietitian";
import { getDietitians } from "../../apiConstants/apiConstants";
import PageSpinner from "../../components/common/PageSpinner";

export default function DietitianDetails() {
  const dietitian = JSON.parse(localStorage.getItem("dietitian"));
  const [Dietitian, setDietitian] = useState();
  const dispatch = useDispatch();
  const allDietitians = useSelector((state) => state.allDietitians);

  useEffect(() => {
    let endpoint = getDietitians + dietitian.companyCode;
    dispatch(getAllDietitians(endpoint));
  }, []);

  useEffect(() => {
    if (allDietitians.data) {
      let dietitianArr = allDietitians.data.filter(
        (item) => item.Dietitian.id === dietitian.id
      );
      setDietitian(dietitianArr[0].Dietitian);
    }
  }, [allDietitians]);

  if (!Dietitian) {
    return <PageSpinner />;
  }

  return (
    <Container fluid className="main-content-container px-4 pb-4">
      <Row noGutters className="page-header py-4">
        <PageTitle
          sm="4"
          title="Patients"
          subtitle="Dietitian"
          className="text-sm-left"
        />
      </Row>

    </Container>
  );
}
